import React from 'react'

export default function TodoItem() {


	return(
		<div className="todo__item">
			<div className="todo__item__content">
				<div className="todo__item__title"> title </div>
				<div className="todo__item__text"> text </div>
			</div>
			<button className="todo__item__btn"> delete </button>
		</div>
	)
}
